import React from 'react';
import Header from './headeraz';
import 'bootstrap/dist/css/bootstrap.css';
import { useTrail, animated} from "react-spring";
import "../css/Dashboard.css";
import apps from './Apps'
const Dashboard = () => {
  function base64ToBlob(base64, mime) 
{
    mime = mime || '';
    var sliceSize = 1024;
    var byteChars = window.atob(base64);
    var byteArrays = [];

    for (var offset = 0, len = byteChars.length; offset < len; offset += sliceSize) {
        var slice = byteChars.slice(offset, offset + sliceSize);

        var byteNumbers = new Array(slice.length);
        for (var i = 0; i < slice.length; i++) {
            byteNumbers[i] = slice.charCodeAt(i);
        }

        var byteArray = new Uint8Array(byteNumbers);

        byteArrays.push(byteArray);
    }

    return new Blob(byteArrays, {type: mime});
}
  
  
  const Herramientas = apps.filter(app => app.tipo === 'opcion2');
  const Gestores = apps.filter(app => app.tipo === 'opcion2');
  const Herramientas_TP = apps.filter(app => app.tipo === 'opcion2');
  const Herramientas_ITMS = apps.filter(app => app.tipo === 'opcion2');
  const CRM= apps.filter(app => app.tipo === 'opcion2');
  const Sistema_Reportes= apps.filter(app => app.tipo === 'opcion2');
  const IAM= apps.filter(app => app.tipo === 'opcion2');
  const CAN= apps.filter(app => app.tipo === 'opcion2');
 
  const trail2 = useTrail(Gestores.length, {  
    from: { opacity: 0, transform: 'translate3d(0, 20px, 0)' },
    to: { opacity: 1, transform: 'translate3d(0, 0, 0)' },
    config: { mass: 1, tension: 500, friction: 40 }
  });
  const trail3 = useTrail(Herramientas_TP.length, {
    from: { opacity: 0, transform: 'translate3d(0, 20px, 0)' },
    to: { opacity: 1, transform: 'translate3d(0, 0, 0)' },
    config: { mass: 1, tension: 500, friction: 40 }
  });
  return (
  <>
   <body class="vista3">
  <Header />
    <div className="card-container">
    <div className='contenedor'>
    <h1>Herramientas de monitoreo</h1>
      <div className='herramientas'>
      {Herramientas.map((animation, index) => (
        <animated.a
          key={index}
          href={Herramientas[index].url}
          target="_blank"
          rel="noopener noreferrer"
          style={animation}
          className="card"
        >
              <div className='centrar_img'>
              <img width='80' height='82' src={base64ToBlob(Herramientas[index].imagen)}/>
              </div>
              <h1>{Herramientas[index].nombre }</h1>
              <p>{Herramientas[index].descripcion}</p>
        </animated.a>
      ))}
      </div>
      <h1>Gestores</h1>
      <div className='Gestores'>
      {trail2.map((animation, index) => (
        <animated.a
          key={index}
          href={Gestores[index].url}
          target="_blank"
          rel="noopener noreferrer"
          style={animation}
          className="card"
        >
              <div className='centrar_img'>
              <img src={Gestores[index].img} />
              </div>
              <h1>{Gestores[index].name}</h1>
              <p>{Gestores[index].description}</p>
        </animated.a>
      ))}
      </div>
    <div className='dashboard'>
    {trail3.map((animation, index) => (
        <animated.a
          key={index}
          href={Herramientas_TP[index].url}
          target="_blank"
          rel="noopener noreferrer"
          style={animation}
          className="card"
        >     <div className='centrar_img'>
              <img src={Herramientas_TP[index].img} />
              </div>
              <h1>{Herramientas_TP[index].name}</h1>
              <p>{Herramientas_TP[index].description}</p>
        </animated.a>
      ))}
    </div>
    <h1>CRM</h1>
<div className='Gestores'>
{CRM.map((animation, index) => (
    <animated.a
      key={index}
      href={CRM[index].url}
      target="_blank"
      rel="noopener noreferrer"
      style={animation}
      className="card"
    >
          <div className='centrar_img'>
          <img src={CRM[index].img} />
          </div>
          <h1>{CRM[index].name}</h1>
          <p>{CRM[index].description}</p> 
    </animated.a>
  ))}
</div>
<h1>Sistemas de Reporte</h1>
<div className='Gestores'>
{Sistema_Reportes.map((animation, index) => (
    <animated.a
      key={index}
      href={Sistema_Reportes[index].url}
      target="_blank"
      rel="noopener noreferrer"
      style={animation}
      className="card"
    >
          <div className='centrar_img'>
          <img src={Sistema_Reportes[index].img} />
          </div>
          <h1>{Sistema_Reportes[index].name}</h1>
          <p>{Sistema_Reportes[index].description}</p>
    </animated.a>
  ))}
</div>
<h1>Herramientas IAM</h1>
<div className='Gestores'>
{IAM.map((animation, index) => (
    <animated.a
      key={index}
      href={IAM[index].url}
      target="_blank"
      rel="noopener noreferrer"
      style={animation}
      className="card"
    >
          <div className='centrar_img'>
          <img src={IAM[index].img} />
          </div>
          <h1>{IAM[index].name}</h1>
          <p>{IAM[index].description}</p>
    </animated.a>
  ))}
</div>
<h1> Control de Acceso al Nodo</h1>
<div className='Gestores'>
{CAN.map((animation, index) => (
    
    <animated.a
      key={index}
      href={CAN[index].url}
      target="_blank"
      rel="noopener noreferrer"
      style={animation}
      className="card"
    >
          <div className='centrar_img'>
          <img src={CAN[index].img} />
          </div>
          <h1>{CAN[index].name}</h1>
          <p>{CAN[index].description}</p>
    </animated.a>
  ))}
</div>
    <h1>Herramientas_ITSM</h1>
    <div className='dashboard'>
    {Herramientas_ITMS.map((animation, index) => (
        
        <animated.a
          key={index}
          href={Herramientas_ITMS[index].url}
          target="_blank"
          rel="noopener noreferrer"
          style={animation}
          className="card"
        >
              <div className='centrar_img'>
              <img src={Herramientas_ITMS[index].img} />
              </div>
              <h1>{Herramientas_ITMS[index].name}</h1>
              <p>{Herramientas_ITMS[index].description}</p>
        </animated.a>
      ))}
    </div>

    </div>
    </div>
    </body>
    </>
  );    
};
export default Dashboard;
